sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new x_snc_fadv.FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	if (inputs.status_code == '201') {
		outputs.status = 'Success';
		outputs.document_id = inputs.response.documentid;
	} else
		outputs = new x_snc_fadv.FirstAdvantageSpokeErrorHandler()
		.attachDocumentsforaSpecificCandidateErrorHandler(inputs, outputs);
})(inputs, outputs);

