sys_variable_value.value:
(function execute(inputs, outputs) {
inputs = new x_snc_fadv.FirstAdvantageSpokeUtils().trimStringInputs(inputs);
  outputs.candidate_id= new x_snc_fadv.FirstAdvantageSpokeUtils().validateCandidate(
		inputs.candidate_id);
//add error handling for doc_type
  outputs.doc_type = inputs.doc_type;
})(inputs, outputs);

